import numpy as np
import matplotlib.pyplot as plt
#create NeuralNetwork class
class NeuralNetwork(object):
  def __init__(self, num_params = 2):
    #3x1 ramdomized weight matrix (column matrix)
    self.weight_matrix = 2 * np.random.random((num_params + 1, 1)) - 1
    self.learning_rate = 1

  def hard_limiter(self, x):
    outs = np.zeros(x.shape)
    outs[x>0] = 1
    return outs

  def forward_propagation(self, inputs):
    outs = np.dot(inputs, self.weight_matrix)
    return self.hard_limiter(outs)

  def pred(self, inputs):
    prob = self.forward_propagation(inputs)
    preds = np.int8(prob >= 0.5)
    return preds

  def train(self, inputs, labels, num_train_iterations = 10):
    for iteration in range(num_train_iterations):
      for i in range(inputs.shape[0]):
        pred_i = self.pred(inputs[i, :])
        if pred_i != labels[i]:
          output = self.forward_propagation(inputs[i, :])
          error = labels[i] - output
          adjustment = self.learning_rate * error * inputs[i]
          self.weight_matrix[:, 0] += adjustment
          print("Iteration: " + str(iteration + 1))
          self.plot_fun(inputs[:, 0:2], labels, self.weight_matrix[:, 0], classes)

def plot_fun(self, features, labels, thre_params, classes):
  #plot data points
  plt.plot(features[labels[:] == classes[0], 0], features[labels[:] == classes[0], 1], 'rs',
            features[labels[:] == classes[1], 0], features[labels[:] == classes[1], 1], 'g^')
  plt.axis([-1.5, 1.5, -1.5, 1.5])
