import numpy as np
import matplotlib.pyplot as plt
#create NeuralNetwork class for Gradient Descent Learning
class NeuralNetworkGDL(object):
  def __init__(self, learning_rate):
    #3x1 ramdomized weight matrix (column matrix)
    np.random.seed(1)
    self.weight_matrix = 2 * np.random.random((3, 1)) - 1
    self.learning_rate = learning_rate
    #create history variable that saves the weights and the training cost after each iteration
    self.history = {
        "previous_weights": [],
        "cost": []
    }

  def forward_propagation(self, inputs):
    #inputs is 10 x 3 and weight matrix is 3 x 1
    outs = np.dot(inputs, self.weight_matrix)
    return outs

  def pred(self, inputs):
    prob = self.forward_propagation(inputs)
    prob[prob >= 0] = 1
    prob[prob < 0] = -1
    return prob

  def train(self, inputs_train, labels_train, num_train_epochs = 10):
    N = inputs_train.shape[0]
    for iteration in range(num_train_epochs):
      outputs = self.forward_propagation(inputs_train) #outputs is 10 x 1
      #calculate error in the output with respect to desired
      error = labels_train - outputs #error is 10 x 1 (d - y)
      adjustment = (self.learning_rate/N)*np.sum(np.multiply(error, inputs_train),axis=0)
      #adjust weight matrix and change history
      self.weight_matrix[:, 0] += adjustment
      self.history["previous_weights"] = self.weight_matrix[:, 0]
      cost = (1/(2 * N)) * np.sum(np.square(error), axis=0)
      self.history["cost"].append(cost[0])
      #plot the separating line based on the weights
      if (iteration + 1) % 5 == 0 or iteration == 0:
        print("Iteration: " + str(iteration + 1))
        self.plot_fun(inputs_train[:, 0:2], labels_train[:, 0], self.weight_matrix[:, 0], classes)

  def plot_fun(self, features, labels, thre_params, classes):
    #plot data points
    plt.plot(features[labels[:] == classes[0], 0], features[labels[:] == classes[0], 1], 'rs',
             features[labels[:] == classes[1], 0], features[labels[:] == classes[1], 1], 'g^')
    plt.axis([-2.5, 2.5, -1.5, 3.5])
    #plot separate line
    x1 = np.linspace(-2.5, 2.5, 100)
    #aX1 + bX2 + cX0 = 0 --> x2 = -(a X1 + cX0)/b
    #thre_params[0] = w1, thre_params[1] = w2, thre_params[2] = w0
    x2 = -((thre_params[0] * x1) + thre_params[2])/thre_params[1] 
    plt.plot(x1, x2, '-r')
    plt.title("Learning Rate: " + str(self.learning_rate))
    plt.xlabel("X1: Feature 1")
    plt.ylabel("X2: Feature 2")
    plt.legend(["Class " + str(classes[0]), "Class " + str(classes[1])])
    plt.show()
#end of Gradient Descent Learning class

#data for neuron
