"""The learning rate determines how aggressively the weights are updated after each iteration to approach the minimum of the loss function. 

When the learning rate is one, the minimum of the loss function is never reached because the average square error does not decrease after each itertion, but rather, the average square error is increasing, which means that this learning rate is not suitable for reaching the minimum for the loss function

When the learning rate is 0.5, we observe that the average square error is now decreasing with each successive iteration; however, when we reach around the tenth iteration, the average square error is relatively constant from that point onwards. This is because we are close to the minima of the loss function and after each iteration, the updating of the weights is less significant because since we are close to the minima, the weights do not need to be drasitically updated to lower the average square error. 

When the learning rate is 0.05, the average square error is decreasing similar to the learning rate of 0.5 except that we approach the minima of the loss function much slower. Because the learning rate is much smaller than 0.5, we might need to do more iterations and wait for the average square error to stabilize so that we have confidence that we are close to the minima of the loss function. The tradeoff here is that although we are much more likely to reach the minima of the loss function, we need to do more iterations to finally reach the minima of the loss function. 

I believe that the learning rate of 0.5 is the most suitable because it is small enough that we have confidence that we will reach the minima of the loss function instead of jumping over it like the learning rate of 1 did. The learning rate is also big enough that we do not have to perform an excessive amount of iterations to reach the minima of the loss function because the learning rate of 0.05 took many more iterations than the learning rate of 0.5 to reach the minima. 
"""